column5:
Remove unnecessary assert

This pattern does not make sense at all because the assert can never fail.

if (condition) {
    XCTAssert(condition, @"comment");
}

Prevent the -Wformat warning when using NSUInteger in the tests

    warning: values of type 'NSUInteger' should not be used as format arguments;
    add an explicit cast to 'unsigned long' instead [-Wformat]
